  const dispatch = useDispatch();
  useEffect(() => {
    fetch("http://localhost:3002/productdata")
      .then((res) => res.json())

      .then((res) => dispatch(SetProduct(res)))
      .catch((err) => console.log(err));
  }, []);
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/"></Route>
          <Route path="/"></Route>
          <Route path="/"></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
